import React from 'react';
import { BuyCalcer, CartItem, NotFoundCartItems, ListCartItems, Inputs } from '../components/cart';
import { Header } from '../components/utils';

export default function Cart() {

    
    return (
        <div>
            
            <Header type={true} />

            <div className="items">
                <Inputs />
                <ListCartItems />
                <BuyCalcer />
            </div>

        </div>
    )
};
